import React from "react";
import CardList from "./cardList";
import {robots} from "./robots";
import Search_Box from "./search_box";

const App = (props) => {
	return (
		<div>
			<h1> Robo-Friends </h1>
			<Search_box />
			<CardList robots={robots}/>
		</div>
	);
}

export default App;
